BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "customer" (
	"C_CUSTKEY"	INT,
	"C_NAME"	TEXT,
	"C_ADDRESS"	TEXT,
	"C_NATIONKEY"	INT,
	"C_PHONE"	TEXT,
	"C_ACCTBAL"	INT,
	"C_MKTSEGMENT"	TEXT,
	"C_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "lineitem" (
	"L_ORDERKEY"	INT,
	"L_PARTKEY"	INT,
	"L_SUPPKEY"	INT,
	"L_LINENUMBER"	INT,
	"L_QUANTITY"	INT,
	"L_EXTENDEDPRICE"	INT,
	"L_DISCOUNT"	INT,
	"L_TAX"	INT,
	"L_RETURNFLAG"	TEXT,
	"L_LINESTATUS"	TEXT,
	"L_SHIPDATE"	DATE,
	"L_COMMITDATE"	DATE,
	"L_RECEIPTDATE"	DATE,
	"L_SHIPINSTRUCT"	TEXT,
	"L_SHIPMODE"	TEXT,
	"L_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "nation" (
	"N_NATIONKEY"	INT,
	"N_NAME"	TEXT,
	"N_REGIONKEY"	INT,
	"N_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "orders" (
	"O_ORDERKEY"	INT,
	"O_CUSTKEY"	INT,
	"O_ORDERSTATUS"	TEXT,
	"O_TOTALPRICE"	INT,
	"O_ORDERDATE"	DATE,
	"O_ORDERPRIORITY"	TEXT,
	"O_CLERK"	TEXT,
	"O_SHIPPRIORITY"	INT,
	"O_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "partsupp" (
	"PS_PARTKEY"	INT,
	"PS_SUPPKEY"	INT,
	"PS_AVAILQTY"	INT,
	"PS_SUPPLYCOST"	INT,
	"PS_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "part" (
	"P_PARTKEY"	INT,
	"P_NAME"	TEXT,
	"P_MFGR"	TEXT,
	"P_BRAND"	TEXT,
	"P_TYPE"	TEXT,
	"P_SIZE"	INT,
	"P_CONTAINER"	TEXT,
	"P_RETAILPRICE"	INT,
	"P_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "region" (
	"R_REGIONKEY"	INT,
	"R_NAME"	TEXT,
	"R_COMMENT"	TEXT
);
CREATE TABLE IF NOT EXISTS "supplier" (
	"S_SUPPKEY"	INT,
	"S_NAME"	TEXT,
	"S_ADDRESS"	TEXT,
	"S_NATIONKEY"	INT,
	"S_PHONE"	TEXT,
	"S_ACCTBAL"	INT,
	"S_COMMENT"	TEXT
);
COMMIT;
